// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UserAccountManagement {
    // State variables
    struct User {
        int256 balance;     // User's balance (can be positive or negative)
        bool isActive;      // User's account status (active or inactive)
    }
    
    mapping(address => User) private users;  // Mapping to store user data by address
    address public owner;                    // Contract owner (only the owner can modify balances)
    
    // Constructor to initialize the owner
    constructor() {
        owner = msg.sender;  // The address that deploys the contract is the owner
    }
    
    // Function to register a new user with an initial balance (optimizing storage usage)
    function registerUser() public {
        require(users[msg.sender].balance == 0, "User already registered.");
        
        // Directly initialize balance and status in a single step to reduce gas costs
        users[msg.sender] = User({ balance: 0, isActive: true });
    }
    
    // Function for the owner to update a user's balance (can be negative or positive)
    function updateBalance(address user, int256 newBalance) public {
        require(msg.sender == owner, "Only the owner can update balances.");
        require(users[user].balance != 0, "User is not registered.");
        
        // Only update balance if it has actually changed to save on gas
        if (users[user].balance != newBalance) {
            users[user].balance = newBalance;  // Update the user's balance
        }
    }
    
    // Function to toggle the user's active status (active/inactive)
    function toggleAccountStatus() public {
        require(users[msg.sender].balance != 0, "User not registered.");
        
        // Only toggle status if it's not already the desired state
        if (users[msg.sender].isActive) {
            users[msg.sender].isActive = false;  // Make account inactive
        } else {
            users[msg.sender].isActive = true;   // Make account active
        }
    }
    
    // Function to get the user's balance
    function getUserBalance() public view returns (int256) {
        return users[msg.sender].balance;  // Return the user's balance
    }
    
    // Function to get the user's account status 
    function getAccountStatus() public view returns (bool) {
        return users[msg.sender].isActive;  // Return the user's active status
    }
}

